function downloadURL(url) { var hiddenIFrameID = 'hiddenDownloader'; iframe = document.getElementById(hiddenIFrameID); if (iframe === null) { iframe = document.createElement('iframe'); iframe.id = hiddenIFrameID; iframe.style.display = 'none'; document.body.appendChild(iframe); } iframe.src = url; return false; };
function printURL(url) {
    var hiddenIFrameID = 'hiddenPrinter';
    iframe = document.getElementById(hiddenIFrameID);
    if (iframe === null) {
        iframe = document.createElement('iframe');
        iframe.id = hiddenIFrameID; iframe.style.display = 'none'; document.body.appendChild(iframe);
    }
    iframe.src = url;
    iframe.focus(); iframe.contentWindow.print();
    return false;
};


// DEV FUDGE
var __baseurl = 'x';
function baseurl() {
    if (__baseurl === 'x') {
        if (location.href.toLowerCase().indexOf('neoopticdev') > -1) {
            __baseurl = '/intaworlddev';
        }
        else {
            __baseurl = '';
        }
    }
    return __baseurl;
}

// allows a function to have a built in "bounce" delay
var rBounce = (function () {
    var timer = 0;
    return function (callback) {
        clearTimeout(timer);
        timer = setTimeout(callback, 600);
    };
})();


// cycling "checkbox" shows a blank or 1 to 4 as you click
// value is stored in a hidden input
/*
    <span class="ric-cyc">
        <span></span>
        <input type="hidden" name="@e.Value" value="0" />
        <label style="white-space:nowrap">&nbsp;&nbsp;@e.Text</label>
    </span>
*/
var __ric_cyc_max = 5;
function ric_cyc_init( clickhandler ) {

    $('.ric-cyc').each(function (index, span) {
        // bind click event
        $(span).click(function () {
            ric_cyc_click(span, clickhandler, false);
        });
        ric_cyc_click(span, clickhandler, true);
    });

}

function ric_cyc_click(span, clickhandler, init) {

    var j = $(span);

    // get initial on-load value
    var i = j.find('input');
    var v = i.val();
    if (!v || v == 0 || v < 1 || v > __ric_cyc_max) {
        v = '';
    }

    // cycle the value
    if (!init) {
        var n = Number(v);
        if (!n || n < 1 || n > __ric_cyc_max || isNaN(n)) {
            n = 0;
        }
        n++;
        if (n > __ric_cyc_max) {
            v = '';
        } else {
            v = '' + n;
        }
        i.val(v);
    }

    //console.log(span, j, i, i.val());
    j.find('span').html(v);

    // clickhandler is a function that - if specified in init - will be called
    // after each "click" of a cycle-box
    if (!init && clickhandler != null && typeof (clickhandler) === 'function') {
        clickhandler();
    }

}

