// DATE INPUTS
//

// when you have a hidden field in the format d/m/y and you
// represent its value via 3 drop-downs for each part
var iw_monthNames = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"];

// e.g. inputs are "#fooday","#foomonth","#fooyear" then call this with "foo"
function iw_getdate(input_prefix) {
    var d = $('#' + input_prefix + 'day').val();
    var m = $('#' + input_prefix + 'month').val();
    var y = $('#' + input_prefix + 'year').val();
    if (m != '' && y != '' && d != '') {
        return d + '/' + m + '/' + y;
    }
    return '';
}

// e.g. inputs are "#fooday","#foomonth","#fooyear" then call this with "foo","25/12/2016" to set christmas
function iw_setdate(input_prefix, dmy) {
    if (dmy && dmy.length) {
        var allld = dmy.split('/');
        if (allld.length > 2) {

         
            var d = parseInt(allld[0]);
            if (d < 10) {
                $('#' + input_prefix + 'day').val('0' + d);
            }
            else {
                $('#' + input_prefix + 'day').val(d);
            }

            // m can be a month name or 1-12
            var m = parseInt(allld[1]);
            if (!isNaN(m)) {
                m -= 1;
                $('#' + input_prefix + 'month').val(iw_monthNames[m]);
            } else {
                $('#' + input_prefix + 'month').val(allld[1]);
            }

            $('#' + input_prefix + 'year').val(allld[2].split(' ')[0]); // extra split in case the input date is "d/m/y h:M:s"

        }
    }
}

// auto-hookup date inputs that use the _DateInput partial view
// e.g.
//@Html.Partial("~/Views/Shared/_DateInput.cshtml", "Feedback_DateIncident")
//@Html.HiddenFor(model => model.Feedback.DateIncident)
//
$(function () {

    $('.dateselector').each(function (index, elem) {


        var input_id = $(elem).attr('data-hidden-id');
        // hook up the 3 date dropdowns to the hidden field that contains the actual value from the model
        $(elem).change(function () {

            var newValue = iw_getdate(input_id);
            $('#' + input_id).val(newValue);

            // automagic _changed event hookup :)
            if (typeof window[input_id + '_changed'] === 'function') {
                window[input_id + '_changed'](newValue);
            }
        });


        iw_setdate(input_id, $('#' + input_id).val());


        //console.log(index, elem.id, input_id, $('#' + input_id).val());

    });

});

//
// $('#element').donetyping(callback[, timeout=1000])
// Fires callback when a user has finished typing. This is determined by the time elapsed
// since the last keystroke and timeout parameter or the blur event--whichever comes first.
//   @callback: function to be called when even triggers
//   @timeout:  (default=1000) timeout, in ms, to to wait before triggering event if not
//              caused by blur.
// Requires jQuery 1.7+
//
; (function ($) {
    $.fn.extend({
        donetyping: function (callback, timeout) {
            timeout = timeout || 1e3; // 1 second default timeout
            var timeoutReference,
                doneTyping = function (el) {
                    if (!timeoutReference) return;
                    timeoutReference = null;
                    callback.call(el);
                };
            return this.each(function (i, el) {
                var $el = $(el);
                // Chrome Fix (Use keyup over keypress to detect backspace)
                // thank you @palerdot
                $el.is(':input') && $el.on('keyup keypress paste', function (e) {
                    // This catches the backspace button in chrome, but also prevents
                    // the event from triggering too preemptively. Without this line,
                    // using tab/shift+tab will make the focused element fire the callback.
                    if (e.type == 'keyup' && e.keyCode != 8) return;

                    // Check if timeout has been set. If it has, "reset" the clock and
                    // start over again.
                    if (timeoutReference) clearTimeout(timeoutReference);
                    timeoutReference = setTimeout(function () {
                        // if we made it here, our timeout has elapsed. Fire the
                        // callback
                        doneTyping(el);
                    }, timeout);
                }).on('blur', function () {
                    // If we can, fire the event since we're leaving the field
                    doneTyping(el);
                });
            });
        }
    });
})(jQuery);